import React from "react";

function Education() {
  return (
    <div id="education-section section">
      <h4>Education</h4>
      <ul id="ed-list">
        <li>Flatiron</li>
        <li>Montclair</li>
        <li>Kean University</li>
      </ul>
    </div>
  );
}

export default Education;
